    18,nt"tags": [],nt"title": "Dissolved inorganic carbon, temperature, salinity
    and other variables collected from discrete sample and profile observations using
    CTD, bottle and other instruments from the POLARSTERN in the Arctic Ocean, Kara
    Sea and Laptev (or Nordenskjold) Sea from 1993-08-06 to 1993-10-05 (NODC Accession
    0113593)",nt"tracking_summary": {ntt"total": 2,ntt"recent": 2nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-27T02:54:10.723736",nt"name":
    "dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-samfa959",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113593 includes chemical,
    discrete sample, physical and profile data collected from POLARSTERN in the Arctic
    Ocean, Kara Sea and Laptev (or Nordenskjold) Sea from 1993-08-06 to 1993-10-05 and
    retrieved during cruise 06ARKIX_4. These data include Barium, CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED
    INORGANIC CARBON, DISSOLVED OXYGEN, Delta Oxygen - 18, HYDROSTATIC PRESSURE, NITRATE,
    PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE.
    The instruments used to collect these data include CTD and bottle. These data were
    collected by Leif Anderson of Gothenburg University; Department of Analytical and
    Marine Chemistry and D.K. Fetterer [affiliation unknown] as part of the CARINA_06AQ19930806
    data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
    is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
    It has produced a merged internally consistent data set of open ocean subsurface
    measurements for biogeochemical investigations, in particular, studies involving
    the carbon system. The original focus area was the North Atlantic Ocean, but over
